	this.addUndoItem([[this.lstCursor_buffer[0],this.lstCursor_buffer[1]],[this.lstCursor_buffer[0],this.lstCursor_buffer[1]],[3,this.lstCursor_buffer[0],this.lstCursor_buffer[1],chrPrevKey,chrNextKey]]);
